extern "C" {
    std::string bintoinputvars(const std::string& binary) {
        std::string result;
        char var = 'A'; // Starting variable
        for (char bit : binary) {
            if (bit == '1') {
                result += var;
            } else if (bit == '0') {
                result += var;
                result += '\'';
            }
            var++;
        }
        return result;
    }

    const char* calculate_minimized_function(const char* truthTable) {
        // Direct conversion of the Python `TruthTableToGates` into a simple workflow
        std::string input(truthTable);

        int NumInputVars = 0;
        std::vector<int> Minterms, Maxterms, DontCares;

        // Parse input
        size_t numVarsStart = input.find('(') + 1;
        size_t numVarsEnd = input.find(')', numVarsStart);
        NumInputVars = std::count(input.begin() + numVarsStart, input.begin() + numVarsEnd, ',') + 1;

        std::istringstream mintermStream(input.substr(input.find("m(") + 2, input.find(")") - input.find("m(") - 2));
        std::string term;
        while (std::getline(mintermStream, term, ',')) {
            Minterms.push_back(std::stoi(term));
        }

        // The actual minimization algorithm should be here. This is a placeholder for Quine-McCluskey implementation.

        std::set<std::string> uniqueTerms;
        // Example processing loop and placeholder logic
        for (int m : Minterms) {
            uniqueTerms.insert(bintoinputvars(std::bitset<8>(m).to_string()));
        }

        std::string answer;
        for (const auto& term : uniqueTerms) {
            answer += term + " + ";
        }
        if (!answer.empty()) {
            answer.pop_back(); // Remove trailing '+'
            answer.pop_back(); // Remove trailing ' '
        }

        // Allocate result and return C-style string
        std::string finalAnswer = "F = " + answer;
        char* result = new char[finalAnswer.size() + 1];
        strcpy(result, finalAnswer.c_str());
        return result;
    }
}

class TruthTableToGates {
public:
    // Constructor to initialize
    TruthTableToGates(const std::string& TruthTable = "")
        : NumInputVars(0), answer("") {
        if (!TruthTable.empty()) {
            parseTruthTable(TruthTable);
        }
    }
    
    std::string getAnswer() {
        if (answer.empty()) {
            answer = "ERROR: The output has not yet been solved for.";
        }
        return answer;
    }
    
    void calculateAnswer() {
        groupByNumOnes();
        findMatchedPairs();
        generatePrimeImplicantsTable();
    }

private:
    int NumInputVars;
    std::string MinorMax;
    std::vector<int> Minterms;
    std::vector<int> Maxterms;
    std::vector<int> DontCares;
    std::string answer;
    
    struct Implicant {
        int group;
        std::string matchedPairs;
        std::string binRep;
        bool checked;
    };
    
    std::vector<Implicant> implicantTable;
    
    void parseTruthTable(const std::string& TruthTable) {
        // Extract the function's variables, minterms, maxterms, and don't cares.
        size_t numVarsStart = TruthTable.find('(') + 1;
        size_t numVarsEnd = TruthTable.find(')', numVarsStart);
        NumInputVars = std::count(TruthTable.begin() + numVarsStart, 
                                  TruthTable.begin() + numVarsEnd, ',') + 1;

        if (TruthTable.find("minterms") != std::string::npos) {
            MinorMax = "minterms";
        } else {
            MinorMax = "maxterms";
        }

        extractNumbers(TruthTable, Minterms, "m(");
        extractNumbers(TruthTable, DontCares, "d(");
        Maxterms = generateMaxterms(NumInputVars, Minterms, DontCares);
    }

    void extractNumbers(const std::string& str, std::vector<int>& container, const std::string& prefix) {
        size_t start = str.find(prefix);
        if (start != std::string::npos) {
            size_t end = str.find(')', start);
            std::string numbers = str.substr(start + prefix.size(), end - start - prefix.size());
            std::stringstream ss(numbers);
            std::string temp;
            while (std::getline(ss, temp, ',')) {
                container.push_back(std::stoi(temp));
            }
        }
    }

    std::vector<int> generateMaxterms(int numVars, const std::vector<int>& minterms, const std::vector<int>& dontCares) {
        std::vector<int> maxterms;
        int totalTerms = 1 << numVars; // 2^numVars
        for (int i = 0; i < totalTerms; ++i) {
            if (std::find(minterms.begin(), minterms.end(), i) == minterms.end() &&
                std::find(dontCares.begin(), dontCares.end(), i) == dontCares.end()) {
                maxterms.push_back(i);
            }
        }
        return maxterms;
    }

    void groupByNumOnes() {
        std::vector<int> terms = Minterms;
        terms.insert(terms.end(), DontCares.begin(), DontCares.end());

        for (int term : terms) {
            std::string binRep = decimalToBinary(term, NumInputVars);
            int numOnes = std::count(binRep.begin(), binRep.end(), '1');
            implicantTable.push_back({numOnes, std::to_string(term), binRep, false});
        }

        std::sort(implicantTable.begin(), implicantTable.end(), [](const Implicant& a, const Implicant& b) {
            return a.group < b.group;
        });
    }

    void findMatchedPairs() {
        bool foundPair;
        do {
            foundPair = false;
            std::vector<Implicant> nextTable;
            for (size_t i = 0; i < implicantTable.size(); ++i) {
                for (size_t j = i + 1; j < implicantTable.size(); ++j) {
                    if (implicantTable[i].group == implicantTable[j].group - 1) {
                        int diff = hammingDistance(implicantTable[i].binRep, implicantTable[j].binRep);
                        if (diff == 1) {
                            foundPair = true;
                            implicantTable[i].checked = true;
                            implicantTable[j].checked = true;

                            std::string newRep = createNewRepresentation(implicantTable[i].binRep, implicantTable[j].binRep);
                            std::string newMps = implicantTable[i].matchedPairs + '-' + implicantTable[j].matchedPairs;

                            if (std::find_if(nextTable.begin(), nextTable.end(), [&](const Implicant& imp) { 
                                return imp.binRep == newRep; }) == nextTable.end()) {
                                nextTable.push_back({implicantTable[i].group, newMps, newRep, false});
                            }
                        }
                    }
                }
            }
            for (const auto& imp : implicantTable) {
                if (!imp.checked) {
                    nextTable.push_back(imp);
                }
            }
            implicantTable = std::move(nextTable);
        } while (foundPair);
    }

    void generatePrimeImplicantsTable() {
        // Map to hold each implicant's binary representation and which minterms they cover
        std::map<std::string, std::set<int>> coverMap;
        for (const auto& imp : implicantTable) {
            std::stringstream ss(imp.matchedPairs);
            std::string item;
            while (std::getline(ss, item, '-')) {
                coverMap[imp.binRep].insert(std::stoi(item));
            }
        }

        std::set<int> uncoveredMinterms(Minterms.begin(), Minterms.end());
        std::set<std::string> essentialPrimeImplicants;

        // Find essential prime implicants
        for (const auto& minterm : Minterms) {
            int coveringCount = 0;
            std::string essentialImplicant;
            for (const auto& [binRep, covers] : coverMap) {
                if (covers.count(minterm)) {
                    coveringCount++;
                    essentialImplicant = binRep;
                }
            }
            if (coveringCount == 1) {
                essentialPrimeImplicants.insert(essentialImplicant);
                const auto& covers = coverMap[essentialImplicant];
                for (int c : covers) {
                    uncoveredMinterms.erase(c);
                }
            }
        }

        // Add necessary prime implicants to cover any remaining uncovered minterms
        while (!uncoveredMinterms.empty()) {
            std::string bestImplicant;
            size_t maxCoverage = 0;

            // Find the implicant that covers the most currently uncovered minterms
            for (const auto& [binRep, covers] : coverMap) {
                std::set<int> currentCoverage;
                set_intersection(covers.begin(), covers.end(),
                                uncoveredMinterms.begin(), uncoveredMinterms.end(),
                                inserter(currentCoverage, currentCoverage.begin()));
                if (currentCoverage.size() > maxCoverage) {
                    bestImplicant = binRep;
                    maxCoverage = currentCoverage.size();
                }
            }

            // Add the best implicant to the solution and mark its minterms as covered
            essentialPrimeImplicants.insert(bestImplicant);
            const auto& covers = coverMap[bestImplicant];
            for (int c : covers) {
                uncoveredMinterms.erase(c);
            }
        }

        // Construct the final answer string with unique prime implicants
        std::set<std::string> uniqueTerms;
        for (const auto& epi : essentialPrimeImplicants) {
            uniqueTerms.insert(bintoinputvars(epi));
        }
        
        for (const auto& term : uniqueTerms) {
            answer += term + " + ";
        }
        
        if (!answer.empty()) {
            answer.pop_back(); // Remove trailing '+'
            answer.pop_back(); // Remove trailing ' '
        }
        answer = "F = " + answer;
    }

    int hammingDistance(const std::string& s1, const std::string& s2) {
        int distance = 0;
        for (size_t i = 0; i < s1.size(); ++i) {
            if (s1[i] != s2[i]) {
                ++distance;
            }
        }
        return distance;
    }
    
    std::string createNewRepresentation(const std::string& s1, const std::string& s2) {
        std::string rep;
        for (size_t i = 0; i < s1.size(); ++i) {
            if (s1[i] == s2[i]) {
                rep += s1[i];
            } else {
                rep += '_';
            }
        }
        return rep;
    }
    
    std::string decimalToBinary(int number, int width) {
        return std::bitset<32>(number).to_string().substr(32 - width, width);
    }
    
    std::string bintoinputvars(const std::string& binary) {
        std::string result;
        char var = 'A'; // Starting variable
        for (char bit : binary) {
            if (bit == '1') {
                result += var;
            } else if (bit == '0') {
                result += var;
                result += '\'';
            }
            var++;
        }
        return result;
    }
};

